INSERT INTO `art` VALUES (26,'JSY14WJ001','14001','毛泽东像（二）','素描复制品','38*29.5','靳尚谊','无','1968年','ad61b0a5-b620-4a5d-887a-86d548ee0095.jpg','这三幅都是用照片创作完成，造型严谨，饱满，生动，传神。','2016-01-26 11:41:11','',1),(27,'JSY14WJ002','14002','毛泽东像（三）','素描复制品','38*29.5','靳尚谊','无','1968年','4e52a942-32e7-43bb-9b54-47ee979477ec.jpg','这三幅都是用照片创作完成，造型严谨，饱满，生动，传神。','2016-01-26 11:42:48','',1),(28,'JSY14WJ003','14003','同学大钱像','纸本素描','55*71','靳尚谊','无','1954年','6635384e-7fa9-4212-acce-33f51ab4f456.jpg','这幅素描借助了纸张本身的纹理，通过控制用笔的力度画出了丰富透气的明暗变化以及细腻的肌理感。','2016-01-26 11:43:51','',1),(29,'JSY14WJ004','14004','女拖拉机手胡友梅','纸本素描','31.5*44.5','靳尚谊','无','1954年','d9f2307d-fffe-4ded-8e4d-7ac5969c6fe3.jpg','人物的动作和身边的工具交代了人物的职业。面部的调子淡雅，明快。身体用概括精炼的线条画出。人物的神情刻画生动。','2016-01-26 11:44:59','',1),(30,'JSY14WJ005','14005','乌鞘岭工地工人','纸本素描','39.5*27.5','靳尚谊','无','1954年','a00b42bf-f752-45cb-b244-dc72967f4108.jpg','面部的暗部整体，透气。人物奕奕有神。身体用速写式的简括线条交代，与刻画细腻的面部形成对照。','2016-01-26 11:46:01','',1),(31,'JSY14WJ006','14006','乌鞘岭工地写生（一）','纸本素描','30*44.5','靳尚谊','无','1954年','d05f4e92-1ce9-43c0-a706-49ecdb740eca.jpg','两幅都为工地的场景写生，作者都注意了构图。第一幅为三角形构图，画面中心处在黄金分割线位置。','2016-01-26 11:48:40','',1),(32,'JSY14WJ007','14007','乌鞘岭工地写生（二）','纸本素描','69*79','靳尚谊','无','1954年','a7043a21-de72-4fee-a7b9-c1c3dbe10ec3.jpg','两幅都为工地的场景写生，作者都注意了构图。第二幅场景布置在画面的远处，增强了纵深感。调子淡雅，线条清晰简练。','2016-01-26 11:49:44','',1),(33,'JSY14WJ008','14008','三门峡架桥班老谢','纸本素描','36*28.5','靳尚谊','无','1956年','25dcb128-e268-400b-bd90-d04c4a0e9813.jpg','这幅素描暗部较淡，但层次丰富，同时细腻地处理了虚实变化。作者准确地画除了皱眉、噘嘴所用到的眼轮匝肌，口轮匝肌群，使得人物表情自然，生动。','2016-01-26 11:50:52','',1),(34,'JSY14WJ009','14009','三门峡工地高兰芬像','纸本素描','38*29','靳尚谊','无','1956年','8601d146-326c-4022-8d57-1d94d42c4f24.jpg','面部的明暗变化描绘得十分细腻饱满，中间调子丰富，准确地表现了人物圆润的面部特征。衣服则用淡雅纤细的线条概括画出。','2016-01-26 11:52:11','',1),(35,'JSY14WJ010','14010','三门峡男钻工像','纸本素描','38*29','靳尚谊','无','1956年','fc6aa96c-7dbc-4457-8e3b-69026f85745a.jpg','这幅素描调子大多使用擦笔揉出，松软自然，明暗既整体又变化微妙。同时眼睑、颈部、耳部轮廓用准确、肯定、遵循结构和明暗的线条画出。线面结合的方式使得人物生动富有气息。','2016-01-26 11:53:08','',1),(36,'JSY14WJ011','14011','锻工刘瑞珠像','纸本素描','36.5*26.5','靳尚谊','无','1956年','a7445d48-2465-431d-a166-49c03869331b.jpg','整体呈亮灰色调，画面淡雅。','2016-01-26 14:10:04','',1),(37,'JSY14WJ012','14012','女农民李玉茹头像','纸本素描','36.5*26.5','靳尚谊','无','1956年','62d04858-5375-40ef-9093-29f45a1180c2.jpg','灰色调子层次丰富，亮部高光直接擦出，明暗对比强烈。造型坚实，具有雕塑感。','2016-01-26 14:11:13','',1),(38,'JSY14WJ013','14013','上钢六厂工人孔林根像','纸本素描','38.5*29.5','靳尚谊','无','1959年','a6c69291-2a12-4667-90e1-750be3d21d63.jpg','用笔简括，精良，侧重于神情和头部结构的提炼。根据面部的厚度，转折，明暗变化，线条的轻重，粗细都有严谨的考究。','2016-01-26 14:12:30','',1),(39,'JSY14WJ014','14014','小女孩像','纸本素描','37.5*26','靳尚谊','无','1959年','b6a720df-9718-4cda-a638-d426866deac8.jpg','这是一张速写，用线松动自然，少许明暗暗示女孩头部的整体圆润结构，更多注重表情的刻画。','2016-01-26 14:13:24','',1),(40,'JSY14WJ015','14015','靳尚诚像（一）','纸本素描','61*80','靳尚谊','无','1959年','8177efcb-b830-432d-a0cb-c3dc1c3cc6e1.jpg','这两幅靳尚诚的肖像，各有特色。（一）的用笔较方，轮廓坚实，多用块面处理结构，雕塑感强，偏向于结构素描。','2016-01-26 14:14:23','',1),(41,'JSY14WJ016','14016','靳尚诚像（二）','纸本素描','38.5*29','靳尚谊','无','1960年','2b52f969-6183-43fc-a3c8-5891a8c71916.jpg','这两幅靳尚诚的肖像，各有特色。（二）的中间色调丰富，明暗过渡柔和，更偏向于明暗素描。','2016-01-26 14:15:31','',1),(42,'JSY14WJ017','14017','延安冯庄公社贾思喜头像','纸本素描','32*29','靳尚谊','无','1960年','7d6dba10-05f4-49cb-870d-f1094ee418d7.jpg','整体色调淡雅，暗部整体。通过画中的线条的方向和轻重变化，可以看出靳尚谊对头部结构的理解。','2016-01-26 14:16:27','',1),(43,'JSY14WJ018','14018','非洲男子（一）','纸本素描','37.5*28','靳尚谊','无','1960年','ab43408a-8240-4b31-b6eb-75d446189260.jpg','这张素描可以看出靳尚谊抓住了非洲男性的面部特征。（一）的色调暗示了非洲男子的深色肤色，而（二）的调子十分淡雅，只对头部结构的转折关系做了全面的交代。','2016-01-26 14:17:43','',1),(44,'JSY14WJ019','14019','非洲男子（二）','纸本素描','39.5*27.5','靳尚谊','无','1960年','31a20e99-45e4-42f4-9279-85f813969882.jpg','这张素描可以看出靳尚谊抓住了非洲男性的面部特征。（一）的色调暗示了非洲男子的深色肤色，而（二）的调子十分淡雅，只对头部结构的转折关系做了全面的交代。','2016-01-26 14:19:14','',1),(45,'JSY14WJ020','14020','非洲妇女','纸本素描','39.5*27.5','靳尚谊','无','1960年','e323ab2d-0046-47bf-b097-b4f357f0d6d0.jpg','线条坚实有力，寓方予圆。通过画中许多地方的线条穿插关系可以看出靳尚谊对于人头部和颈部结构的理解。','2016-01-26 14:20:23','',1),(46,'JSY14WJ021','14021','农村青年像','纸本素描','38×28.5','靳尚谊','无','1962年','c8275e44-2669-4489-8854-ebc306d5ff29.jpg','这幅素描在这批素描中颇为另类，靳尚谊舍弃了坚实的结构塑造而注重光影变化的描绘。人物的边界与背景像烟雾一般柔和地融在一起，风格上有点接近于修拉的新印象派素描。','2016-01-26 14:24:07','',1),(47,'JSY14WJ022','14022','杨诚诚头像','纸本素描','38*29','靳尚谊','无','1962年','73cbba57-0404-4b39-ba46-99b9a88805ae.jpg','这幅肖像只用极少淡雅的调子暗示体积感，而重点通过明晰、优美、准确的线条表现出模特清新、古典、端庄的气质，包含了一定的中国画线描风格。早年靳尚谊虽学习苏联画风，但从这张素描中可以看出他已经在追求和探索适合表现东方女性含蓄、古典气质的画法。','2016-01-26 14:41:36','',1),(48,'JSY14WJ023','14023','战士刘根来像','纸本素描','39.5*27','靳尚谊','无','1973年','742df393-ffd6-4fb7-828a-d3ea05f0f62d.jpg','这幅素描作画速度较快，用块面处理头部关系。调子用擦笔大面积铺开，暗部整体。','2016-01-26 14:42:39','',1),(49,'JSY14WJ024','14024','农村女娃像','纸本素描','39.5*27.5','靳尚谊','无','1974年','c0f6c43f-fb36-48e9-ac5f-d0657523e636.jpg','用笔自然松弛，女孩的形象生动传神。','2016-01-26 14:43:48','',1),(50,'JSY14WJ025','14025','战士刘业余像','纸本素描','35×30.5','靳尚谊','无','1975年','edc4cbfb-93ef-4ee4-9062-82483bc89a5f.jpg','通过描绘衣着和配枪表明出画中人物的身份，而经营人物侧面凝视前方的肖像姿势，也很好地表现了刘业余身为战士爱岗敬业的形象。','2016-01-26 14:45:16','',1),(51,'JSY14WJ026','14026','男青年像','纸本素描','34*27.5','靳尚谊','无','1976年','a8e185a1-65e3-441f-bc2b-7f651920cb7e.jpg','这几幅素描的完成度很高，调子细腻而富有变化，有皮肤的肌理感。','2016-01-26 14:47:17','',1),(52,'JSY14WJ027','14027','中学生像','纸本素描','38.5*29','靳尚谊','无','1976年','5a613a9c-8f5c-4130-a1ff-40400422af2b.jpg','这几幅素描的完成度很高，调子细腻而富有变化，有皮肤的肌理感。','2016-01-26 14:48:54','',1),(53,'JSY14WJ028','14028','井下作业女工头像','纸本素描','44.5*30.5','靳尚谊','无','1977年','2096ee9c-edc3-476b-a5a5-259e1625a333.jpg','调子明快，线面结合，笔法丰富精炼，用线十分考究。塑造的人物神情生动。','2016-01-26 14:51:56','',1),(54,'JSY14WJ029','14029','张晴头像','纸本素描','43*31','靳尚谊','无','1977年','57eede81-2d74-4917-9868-3fa938c2c174.jpg','这几幅素描的完成度很高，调子细腻而富有变化，有皮肤的肌理感。','2016-01-26 14:52:50','',1),(55,'JSY14WJ030','14030','甘南藏族文工团慈成母','纸本素描','39*27.5','靳尚谊','无','1978年','4ec94276-efa4-4342-b42c-dab9f00f5438.jpg','调子多用擦笔抹出，可以看出作画的老练，速度较快，一气呵成。','2016-01-26 14:53:45','',1),(56,'JSY14WJ031','14031','甘南藏族文工团道路头像','纸本素描','39.5*27.5','靳尚谊','无','1978年','0f785727-ce1b-49e7-a8d4-eb00be748ef0.jpg','调子多用擦笔抹出，可以看出作画的老练，速度较快，一气呵成。','2016-01-26 14:54:44','',1),(57,'JSY14WJ032','14032','北汽工厂磨工丁秋