寒风中走来，不是作战，而是撤退。\r\n从士兵们松弛的面部表情和缓慢的步调可以看出来。\r\n黑色装备的骑兵是“风”部队\r\n绿色旗幡执长矛的步兵师“林”部队\r\n红色装备的骑兵是”火“部队\r\n白色菱形的武田家徽旗幡在寒风中呼啦啦的响不停。','2016-04-06 13:41:46','',1),(92,'HZM16WJ005','16005','影子武士','纸本绘画','无','黑泽明','无','1980年','db2633eb-9be3-4a10-b946-6ed9e98814d5.jpg','武田信玄受伤后，在凤来寺的意见屋子里，所有的围着（武田胜赖、马场、山县、高阪等）宿将的表情也非常阴沉，画面灰浊的色调表达了所有人在面对突然的打击时的紧张气氛。','2016-04-06 13:42:36','',1),(93,'HZM16WJ006','16006','影子武士','纸本绘画','无','黑泽明','无','1980年','b143fa0a-e14b-4745-852c-553c63a677db.jpg','在渔人小屋里，德川派出的间谍和托钵僧装束的织田的间谍，挤在昏暗的一角，望着湖上和岸边的信廉等人，小声谈话。\r\n黑泽明把三个间谍和影子武士分别构于画面的左右两边，一上一下，从木屋的破损缝隙中露出头来探，分明的展现阴暗的角落里的偷听与被偷听的情形。','2016-04-06 13:43:31','',1),(94,'HZM16WJ007','16007','影子武士','纸本绘画','无','黑泽明','无','1980年','7dc8ca95-3003-46a4-b016-3600e8d6c6e6.jpg','血光里的战场，画面中直接用血红色的光做背景，把战争场面的残酷直观的表达出来。\r\n这也是黑泽明常用的一种超现实的表现手法。','2016-04-06 13:44:25','',1),(95,'HZM16WJ008','16008','影子武士','纸本绘画','无','黑泽明','无','1980年','81ea3ebb-f893-4251-8f0b-94440222cf85.jpg','这是武田家最后一场大战中全军覆没的场景。\r\n惊天动地的轰响中，象崩塌的黑雪一般，失掉主人而狂奔的无数战马。\r\n噩梦一般的画面，在设定时，黑泽明用蓝色庙会战士们的遗体，鬼畜一般的展现了战场上的惨烈情形，死去的士兵东倒西歪，被击中的战马对着天空嚎叫。','2016-04-06 13:46:19','',1),(96,'HZM16WJ009','16009','影子武士','纸本绘画','无','黑泽明','无','1980年','00fd429d-2dce-40ad-9ced-2c0962531320.jpg','这是武田家最后一场大战中全军覆没的场景。\r\n惊天动地的轰响中，象崩塌的黑雪一般，失掉主人而狂奔的无数战马。\r\n噩梦一般的画面，在设定时，黑泽明用蓝色庙会战士们的遗体，鬼畜一般的展现了战场上的惨烈情形，死去的士兵东倒西歪，被击中的战马对着天空嚎叫。','2016-04-06 13:48:45','',1),(97,'HZM16WJ010','16010','影子武士','纸本绘画','无','黑泽明','无','1980年','cac71a34-138b-4ad6-8d41-bec6db32fb5a.jpg','分别是导演在初期设定时所画的道具设计，女眷们的发饰与士兵们的表情。','2016-04-06 13:50:26','',1),(98,'HZM16WJ011','16011','影子武士','纸本绘画','无','黑泽明','无','1980年','3c2d4732-1ee2-4e8e-8624-ebf314966d72.jpg','分别是导演在初期设定时所画的道具设计，女眷们的发饰与士兵们的表情。','2016-04-12 16:10:09','',1),(99,'HZM16WJ012','16012','影子武士','纸本绘画','无','黑泽明','无','1980年','d759d7c2-42c9-4b0f-877d-2ccbc4186273.jpg','分别是导演在初期设定时所画的道具设计，女眷们的发饰与士兵们的表情。','2016-04-12 16:15:55','',1),(100,'HZM16WJ013','16013','影子武士','纸本绘画','无','黑泽明','无','1980年','898e67f4-9bdb-4304-a5bc-2f622db76436.jpg','分别是导演在初期设定时所画的道具设计，女眷们的发饰与士兵们的表情。','2016-0