087','袅袅夕阳情','纸本绘画','无','黑泽明','无','1993年','c0d527c6-cc4a-42b1-b59e-c99069cfe6ef.jpg','遭到炮轰后，内田教授与妻子便在这所陋室之中过着隐居的生活。\r\n画中分别画了夏天与秋天时的景象，影片中将四季全部展现。毫无技巧的忠实陈述，却道出了天地浩渺。见山还是山，见水还是水，山水风云变幻，对生命的诠释都包含其中。','2016-04-19 11:27:09','',1),(181,'HZM16WJ088','16088','袅袅夕阳情','纸本绘画','无','黑泽明','无','1993年','dae48885-4a57-40f7-ad79-745a03826db6.jpg','遭到炮轰后，内田教授与妻子便在这所陋室之中过着隐居的生活。\r\n画中分别画了夏天与秋天时的景象，影片中将四季全部展现。毫无技巧的忠实陈述，却道出了天地浩渺。见山还是山，见水还是水，山水风云变幻，对生命的诠释都包含其中。','2016-04-19 11:28:06','',1),(182,'HZM16WJ089','16089','袅袅夕阳情','纸本绘画','无','黑泽明','无','1993年','204fbc5d-051d-4326-b04f-edeea703e720.jpg','在从九州回来的列车上，内田教授忽然透过车窗看到了他收养的猫咪，他惊讶的站起身，向上推开车窗，眼睛一直盯着那只猫。此时，列车已经缓缓开动。','2016-04-19 11:28:50','',1),(183,'HZM16WJ090','16090','袅袅夕阳情','纸本绘画','无','黑泽明','无','1993年','fc968c81-81bd-4ef3-ae0d-29023d24017e.jpg','教授在小学校门口分发寻找罗亚（猫咪）的启示。','2016-04-19 11:29:30','',1),(184,'HZM16WJ091','16091','袅袅夕阳情','纸本绘画','无','黑泽明','无','1993年','dffcabaf-5f90-4ecc-abf0-9b5476288aba.jpg','无','2016-04-19 11:30:16','',1),(185,'HZM16WJ092','16092','海之见','纸本绘画','无','黑泽明','无','2002年','76e9ce2b-b289-4d8d-b525-d96be86a55d3.jpg','无','2016-04-19 11:31:16','',1),(186,'HZM16WJ093','16093','海之见','纸本绘画','无','黑泽明','无','2002年','6c871eac-d092-4052-9088-b9eca6ea9e17.jpg','无','2016-04-19 11:32:07','16093.MP3',1),(187,'HZM16WJ094','16094','海之见','纸本绘画','无','黑泽明','无','2002年','6655a587-7115-48a8-938a-c4b4177a0268.jpg','无','2016-04-19 11:33:05','16094.MP3',1),(188,'HZM16WJ095','16095','海之见','纸本绘画','无','黑泽明','无','2002年','a2fb6df3-fbe9-4417-83bd-f4d91fb17fcb.jpg','无','2016-04-19 11:33:53','16095.MP3',1),(189,'HZM16WJ096','16096','海之见','纸本绘画','无','黑泽明','无','2002年','becc1174-0453-4628-ba73-11f20f6ad461.jpg','无','2016-04-19 11:34:45','16096.MP3',1),(190,'HZM16WJ097','16097','海之见','纸本绘画','无','黑泽明','无','2002年','2f69ba32-04bd-4900-8037-fe85ac18a541.jpg','无','2016-04-19 11:35:14','16097.MP3',1),(191,'HZM16WJ098','16098','海之见','纸本绘画','无','黑泽明','无','2002年','06d5d816-6047-42fc-8e47-df184c5d5b5b.jpg','无','2016-04-19 11:37:25','16098.MP3',1),(192,'HZM16WJ099','